buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>106 spotkanie WJUGa</h4>\n            <h2>Praktyczne wprowadzenie do OSGi i Enterprise OSGi</h2>\n            <h3>Maciej Jankowski, Wojtek Erbetowski</h3>\n            <p>Termin: 08.01.2013 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <p>Sponsor:<a href="http://polidea.pl/" target="_blank"> Polidea</a></p>\n            <p>Zapisy i dyskusja<a href="http://www.meetup.com/Warszawa-Java-User-Group-Warszawa-JUG/events/97869552/" target="_blank"> Meetup</a></p>\n            <p>Slajdy<a href="https://docs.google.com/file/d/0B3sikUV-sttFU2JiY3FEZnhVYWs/edit" target="_blank"> slajdy Maćka,</a><a href="https://github.com/wojtekerbetowski/metaprogramming-in-java-slides" target="_blank"> slajdy Wojtka</a></p>\n            <p>Opis: Ten wykład to absolutny "must" dla wszystkich developerów związanych z Javą (i w ogóle JVM). Początkujący w temacie dowiedzą się podstaw działania większości Javowych frameworków, czyli o manipulacjach na bytecode. Dowiecie się jak narzędzia są w stanie m. in. utworzyć mocki nagrywające wywołania w testach, czy założyć transakcje na naszą logikę biznesową. Mimo, że zaczniemy od podstaw w prezentacji będzie też kilka ciekawostek i uzupełnień wiedzy dla wytrawnych programistów. Zaczniemy od wprowadzenia do generowania bytecodu, łącznie z pokazaniem, jak zrobić prostą klasę z niczego w czasie działania aplikacji. Następnie zobaczycie jak opakowują to najpopularniejsze biblioteki w używalny kod, oraz kto (jakie popularne frameworki) z tych narzędzi korzysta. Później już bardzo konkretnie opowiemy o CGLib, który w tej dziedzinie jest de facto standardem, a na sam koniec narzędzie, które powstało stosunkowo niedawno, czyli Plastic.</p>\n            <p>O prelegentach: Maciej od ośmiu lat programuje w Javie. Od pięciu lat komercyjnie. Nie lubi przetartych szlaków. Pasjonat nietypowych rozwiązań. Obecnie pracuje jako programista Java.</p>\n            <p>Wojtek jest Wam znany jako jeden z organizatorów warszawskiego JUG. W pracy programuje w Groovym, Scali i Javie, a także w Pythonie. Ostatnio stworzył bibliotekę RoboSpock, przy okazji której podszkolił się z tematu ładowania klas w Javie. Po godzinach już rozgląda się za nowym językiem/technologią.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/XgDWF5iTnKo" frameborder="0" allowfullscreen></iframe></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
